function toggleFullscreenVideo(videoId, triggerClass) {
  let $video = $(videoId);

  if ($video.length > 0) {
    let video = $video[0];
    
    $(triggerClass).on('click', (event) => {
      event.preventDefault();

      if (video.requestFullscreen) {
        video.requestFullscreen();
      } else if (video.webkitRequestFullscreen) { // Safari
        video.webkitRequestFullscreen();
      } else if (video.msRequestFullscreen) { // IE11
        video.msRequestFullscreen();
      }
    });

    $video.on('fullscreenchange', (event) => {
      let isEnteringFullscreen = document.fullscreenElement !== null;

      if (isEnteringFullscreen) {
        $video.addClass('active');
        video.play();
      } else {
        $video.removeClass('active');
        video.pause();
        video.currentTime = 0;
        video.load();
      }

      video.muted = !isEnteringFullscreen;
    });
  }
}

$(document).ready(() => {
  toggleFullscreenVideo('#vrvideo', '.js-startvrvideo');
  toggleFullscreenVideo('#xrvideo', '.js-startxrvideo');
  toggleFullscreenVideo('#aivideo', '.js-startaivideo');
  toggleFullscreenVideo('#virtualprodvideo', '.js-startvirtualprodvideo');
});
